let style = {
    width: 40,
    height: 30,
    backgroundColor: "#063b50",
    margin: "10px 0 0 10px",
    borderRadius: '0 5px 0 0',
    cursor: 'pointer',
    marginLeft: 'auto'
}

let settingsLine = {
    width: 18,
    height: 1,
    backgroundColor: '#e4f7ff',
    margin: 'auto'
}

export default function Settings() {
    return (
        <div>
            <div style={{...settingsLine, marginTop: 10}}></div>
            <div style={{...settingsLine, marginTop: 4}}></div>
            <div style={{...settingsLine, marginTop: 4}}></div>
        </div>
    )
}
